import classes from './UserList.module.css';

const UserList = () => {
  return (
    <div className={classes.users}>
      <ul>
          <li>Nimit</li>
          <li>Nimit</li>
          <li>Nimit</li>
      </ul>
    </div>
  )
}

export default UserList
